import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      {/*  wihtout page reaload */}
      <NavLink exact activeClassName="active_class" to="/">
        About us{" "}
      </NavLink>
      <NavLink activeClassName="active_class" to="/Contact">
        Contact us{" "}
      </NavLink>
    </>
  );
};

export default Menu;
